import React,{Component} from 'react';

class Count extends Component {
    state = {
        count :1,
        address: {
            street: "main",
            city : "San Francisco",
            state : "California "
        }
    }

    render(){
        return(
            <div>
                <h1>{this.check()}</h1>
                <h3>{this.state.address.street}</h3>
            </div>
        );
    }

    check(){
       return  this.state.count === 1 ? 'one' : this.state.count;
    }
}

export default Count;
